import React from "react";
import "../Home.css";
import "bootstrap/dist/css/bootstrap.min.css";


import Header from "../LandingPage/head";
import Footer from "../LandingPage/footer";
import FundoImgNft from "../LandingPage/FundoImgNft";
import GoTokensNft from "../LandingPage/GoTokensNft";
import Espaço from "../LandingPage/Espaço";
import FundoImgTokenizeTudo from "../LandingPage/fundoImgTokenizeTudo";
import TokenizeTudo from "../LandingPage/TokenizeTudo";
import SeuEspacoPessoal from "../LandingPage/SeuEspacoPessoal";
import Praticidade from "../LandingPage/Praticidade";
import UtylityTokens from "../LandingPage/ProgamaFanToken";
import RoadMap from "../LandingPage/VendaSeuNFT";




function Home() {
  return (
    <React.Fragment>
      <FundoImgNft/>
      <Header/>
      <GoTokensNft/>
      <Espaço/>
      <FundoImgTokenizeTudo/>
      <TokenizeTudo/>
      <SeuEspacoPessoal/>
      <Praticidade/>
      <UtylityTokens/>
      <RoadMap/>
      <Footer />
    </React.Fragment>
  );
}


export default Home;
